import React from "react";
import ""
function FeturesData() {
  let data = [
    {
      id: 1,
      name: "paintBrushes",
      img: "https://www.thesprucecrafts.com/thmb/Pz-yTNsj4Xkjof1l_SBuCsDKu70=/1500x0/filters:no_upscale():max_bytes(150000):strip_icc()/paint-brushes-139613265-5817711f5f9b581c0b53b9a4.jpg",
      desc:"softer and fine edges brushes"
    },
    {
      id: 2,
      name: "colors",
      img: "https://i.ytimg.com/vi/UJ9iV407Sro/hqdefault.jpg",
      desc:"colors as your imagination"
    },
    {
      id: 3,
      name: "clay-arts",
      img: "https://images-na.ssl-images-amazon.com/images/I/71Zho4Fz4oL._AC_UL900_SR615,900_.jpg",
      desc:" play with clay"
    },
  ];
  return (
    <>
      {data.map((card) => {
        return (
          <>
            <div className="cards" key={card.id}>
              <img src={card.img} alt={card.name} />
              <div className="card-img-overlay">
                <h5 className="card-title">{card.name}</h5>
                <p className="card-text">{card.desc}</p>
                <p className="card-text">Last updated 3 mins ago</p>
              </div>
            </div>
          </>
        );
      })}
    </>
  );
}

export default FeturesData;
